import React, { Component } from 'react'
import {connect} from 'react-redux'
 class Message extends Component {
    render() {
        return (
            <div>
                {this.props.note.map(message=>{
                    return (
                        <h1> {message.name}</h1>
                    )
                }) }
            </div>
        )
    }
}
function mapStateToProps(state){
    return {
         note: state.messages
    }
  }
  export default connect(mapStateToProps) (Message)
